        <div class="other-1">
            <h1><strong>『セキュリティメタデザイン研究室』</strong>について</h1>
            <div class="images fup">
                <img src="@/assets/secumetadesign.png" alt="security-meta-design-lab">
                <img src="@/assets/security_image.png" alt="what-is-information-security">
            </div>
            
            <p>情報システム学科関研究室（情報セキュリティ）はこれまで教授として指導していた関先生が2023年に開設された
                デザインデータ科学部の学部長として移動される事から、解体、再構築され、「セキュリティメタデザイン研究室」として生まれ変わります。
            </p>
            <h2>"つながる"に<strong>もっと</strong>安心を</h2>
            <p>「”つながる” にもっと安心を」をキャッチフレーズとして、データに基づく新たなネットワークセキュリティを創造します。
                共通の仕事や目的のために働く利用者のグループ支援に着目して、社会的、経済的、技術的な基盤を再定義し、創り出すことを目指します。
                情報サービスを安全に提供するためには、サービス提供者が利便性を犠牲にしてもリスクを回避すべきですが、安全性の確保はサービス提供者側だけでは解決できない社会問題化しています。
                そこで、本研究室では、利用者自身が各種セキュリティ脅威を認識できる情報共有システムの構築に向けて、先端技術に注目して取り組みます。
            </p>
            <a class="fup" href="https://tcu-labo.com/labo" target="_blank" rel="noopener noreferrer">詳しくはこちら（外部サイト）</a>
        </div>
        <hr>
        <div class="other-2">
            <h2 class="fup">That's Seminar資料</h2>
            <p>That's Seminarとは情報システム学科学生会の主催する新学部3年生のための研究室紹介イベントです。研究室についての詳しい概要はこちらからも確認できます。（資料は2022年に配布されたものです。）</p>
